import React, { useState, useEffect } from "react";
import { useSpring, animated } from "react-spring";
import "./LogoAnimation.css"; // Import your CSS file for styling

const LogoAnimation = () => {
  const [show, setShow] = useState(false);

  useEffect(() => {
    setShow(true);
  }, []);

  const nPath = "M20,50 L20,20 L30,20 L30,40 L40,20 L40,50";
  const tPath = "M50,20 L80,20 L65,20 L65,50";

  const nProps = useSpring({
    from: { pathLength: 0 },
    to: { pathLength: show ? 1 : 0 },
    config: { duration: 1500 },
    delay: 500, // Adjust delay to control animation timing
  });

  const tProps = useSpring({
    from: { pathLength: 0 },
    to: { pathLength: show ? 1 : 0 },
    config: { duration: 1500 },
    delay: 1000, // Adjust delay to control animation timing
  });

  return (
    <div className="logo-container">
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 120 60">
        <g fill="none" stroke="#000" strokeWidth="2">
          <animated.path
            d={nPath}
            strokeDasharray="100"
            strokeDashoffset="100"
            style={nProps}
          />
          <animated.path
            d={tPath}
            strokeDasharray="100"
            strokeDashoffset="100"
            style={tProps}
          />
        </g>
      </svg>
    </div>
  );
};

export default LogoAnimation;
